/// <summary>
/// Finds a record in the <c>BudgetPlanLineActiveView</c> table.
/// </summary>
/// <param name='_budgetPlanLineActiveViewRecId'>
/// The record ID of the <c>BudgetPlanLineActiveView</c> record.
/// </param>
/// <param name='_forUpdate'>
/// A Boolean value that indicates whether to read the record for update; optional.
/// </param>
/// <param name='_concurrencyModel'>
/// The concurrency model option to use when the record is read; optional.
/// </param>
/// <returns>
/// A record in the <c>BudgetPlanLineActiveView</c> table; otherwise, an empty record.
/// </returns>
public static BudgetPlanLineActiveView find(
    BudgetPlanLineActiveViewRecId   _budgetPlanLineActiveViewRecId,
    boolean                         _forUpdate = false,
    ConcurrencyModel                _concurrencyModel = ConcurrencyModel::Auto)
{
    BudgetPlanLineActiveView budgetPlanLineActiveView;

    if (_budgetPlanLineActiveViewRecId)
    {
        budgetPlanLineActiveView.selectForUpdate(_forUpdate);

        if (_forUpdate && _concurrencyModel != ConcurrencyModel::Auto)
        {
            budgetPlanLineActiveView.concurrencyModel(_concurrencyModel);
        }

        select firstOnly budgetPlanLineActiveView
            where budgetPlanLineActiveView.RecId == _budgetPlanLineActiveViewRecId;
    }

    return budgetPlanLineActiveView;
}

/// <summary>
/// Checks if the <c>RecVersion</c> of a given <c>BudgetPlanLineActiveView</c> buffer is current with the record on the database.
/// </summary>
/// <returns> true, if the buffer is current with the database; otherwise, false. </returns>
public boolean isCurrent()
{
    boolean isCurrent = true;
    if (BudgetPlanLineActiveView::find(this.RecId).RecVersion != this.RecVersion)
    {
        isCurrent = false;
        error(strFmt("@Budget:BudgetPlanningOutOfDateRecordError", tableStr(BudgetPlanLineActiveView)));
    }

    return isCurrent;
}

public boolean validateDelete()
{
    boolean isValid = super();

    if (isValid && this.RecId)
    {
        BudgetPlan budgetPlan = BudgetPlan::construct();
        budgetPlan.parmBudgetPlanHeader(BudgetPlanHeader::find(this.BudgetPlanHeader));

        isValid = isValid && budgetPlan.checkBudgetPlanCurrentLayoutForEdit(this, true);

        BudgetPlanHeader budgetPlanHeader = BudgetPlanHeader::find(this.BudgetPlanHeader);
        if (budgetPlanHeader)
        {
            isValid = !BudgetPlan::isUserBlocked(budgetPlanHeader, true) && isValid;
        }
    }

    return isValid;
}

public void delete()
{
    if (this.RecId)
    {
        if (BudgetPlanLineActiveViewDetailStatus::existsByHeaderActiveView(this.BudgetPlanHeader, this.RecId))
        {
            BudgetPlanActiveView::refreshBudgetPlanLineActiveViewDetail(this.BudgetPlanHeader);
        }

        BudgetPlanLine::deleteLinesByActiveView(this.RecId);
        BudgetPlanLineActiveViewDetail::deleteLinesByActiveView(this.RecId);
    }

    super();
}

/// <summary>
/// Gets the next available line number for the <c>BudgetPlanLineActiveView</c> table records.
/// </summary>
/// <returns>
/// The next line number to be used.
/// </returns>
public LineNum getNextLineNum()
{
    return (select maxof(LineNumber) from budgetPlanLineActiveView where budgetPlanLineActiveView.BudgetPlanHeader == this.BudgetPlanHeader).LineNumber + 1;
}

