/// <summary>
/// Reacts to the validation of a field value.
/// </summary>
/// <param name = "_fieldIdToCheck">The field ID of the field to be validated.</param>
/// <returns> true, if the field to be checked is valid; otherwise, false. </returns>
public boolean validateField(FieldId _fieldIdToCheck)
{
    boolean isValid = this.isCurrent();

    // Both asset table and project table save data per company. Validation fails due to company context.
    if (isValid
        && _fieldIdToCheck != fieldNum(BudgetPlanLineActiveView, AssetId)
        && _fieldIdToCheck != fieldNum(BudgetPlanLineActiveView, ProjectId)
        && _fieldIdToCheck != fieldNum(BudgetPlanLineActiveView, SourceDataAreaId))
    {
        isValid = super(_fieldIdToCheck);
    }

    if (_fieldIdToCheck != fieldNum(BudgetPlanLineActiveView, SourceDataAreaId))
    {
        if (isValid)
        {
            BudgetPlanLineItemActiveView budgetPlanLineItemActiveView = BudgetPlanLineItemActiveView::newFromActiveViewLine(this);

            isValid = budgetPlanLineItemActiveView.validateField(_fieldIdToCheck);
        }
    }

    return isValid;
}

