/// <summary>
/// Inserts the <c>BudgetPlanLineActiveView</c> record into the database.
/// </summary>
public void insert()
{
    this.setBudgetPlanHeaderInUse();

    BudgetPlanLineItemActiveView budgetPlanLineItemActiveView = BudgetPlanLineItemActiveView::newFromActiveViewLine(this);
    budgetPlanLineItemActiveView.insert();

    // Insert when called from form.
    // When called from data entity, the insert is handled by the active view manager.
    if (FormDataUtil::isFormDataSource(this))
    {
        super();
    }

    this.resetBudgetPlanHeaderInUse();
}

