/// <summary>
/// Retrieves the name of a Asset for display.
/// </summary>
/// <returns>
/// The name of the Asset.
/// </returns>
[SysClientCacheDataMethodAttribute(true)]
display AssetName displayAssetName()
{
    AssetName assetName;

    if (this.AssetId)
    {
        changecompany(this.SourceDataAreaId)
        {
            assetName = AssetTable::find(this.AssetId).Name;
        }
    }

    return assetName;
}

