/// <summary>
/// Validates the <c>BudgetPlanLineActiveView</c> record before it is written to the database.
/// </summary>
/// <returns> true if the record is valid to be written; otherwise, false. </returns>
public boolean validateWrite()
{
    boolean                         isValid;
    BudgetPlanLineItemActiveView    budgetPlanLineItemActiveView;

    budgetPlanLineItemActiveView = BudgetPlanLineItemActiveView::construct();
    budgetPlanLineItemActiveView.parmBudgetPlanLineActiveView(this);

    isValid = super();

    if (isValid && !FormDataUtil::isFormDataSource(this) && this.isDuplicate())
    {
        isValid = checkFailed("@Budget:DuplicateActiveViewLineWarning");
    }

    isValid = isValid && budgetPlanLineItemActiveView.checkBudgetPlanLineForWrite();

    if (isValid && !this.isAnyDimensionValueSet())
    {
        isValid = checkFailed("@Budget:CannotCreateLineWithoutDimension");
    }

    return isValid;
}

