/// Determines whether any <c>DimensionValue</c> fields are set for the current <c>BudgetPlanLineActiveView</c> record.
/// </summary>
/// <returns> true if any <c>DimensionValue</c> field is set; otherwise, false. </returns>
public boolean isAnyDimensionValueSet()
{
    boolean isDimensionValueSet = true;

    if (this.DimensionValue1 == '' && this.DimensionValue2 == '' && this.DimensionValue3 == '' && this.DimensionValue4 == ''
        && this.DimensionValue5 == '' && this.DimensionValue6 == '' && this.DimensionValue7 == '' && this.DimensionValue8 == ''
        && this.DimensionValue9 == '' && this.DimensionValue10 == '' && this.DimensionValue11 == '')
    {
        isDimensionValueSet = false;
    }

    return isDimensionValueSet;
}

/// <summary>
/// Determines whether the current <c>BudgetPlanLineActiveView</c> is duplicate of an existing active view record.
/// </summary>
/// <returns> true if a duplicate <c>BudgetPlanLineActiveView</c> record was found; otherwise, false. </returns>
public boolean isDuplicate()
{
    BudgetPlanLayoutRecId layoutRecId = BudgetPlanHeader::find(this.BudgetPlanHeader).Layout;
    BudgetPlanLineActiveView lineActiveView;
    boolean matchIsRecurring = BudgetPlanLayoutMapping::findByLayoutFieldNum(
                                    layoutRecId,
                                    BudgetPlanLayoutManager::getSqlFieldNum(tableNum(BudgetPlanLineActiveView), fieldNum(BudgetPlanLineActiveView, IsRecurring))) != null;
    boolean matchCurrency = BudgetPlanLayoutMapping::findByLayoutFieldNum(
                                    layoutRecId,
                                    BudgetPlanLayoutManager::getSqlFieldNum(tableNum(BudgetPlanLineActiveView), fieldNum(BudgetPlanLineActiveView, TransactionCurrencyCode))) != null;

    select firstonly RecId from lineActiveView
        where lineActiveView.RecId                      != this.RecId
            && lineActiveView.BudgetPlanHeader          == this.BudgetPlanHeader
            && lineActiveView.AssetId                   == this.AssetId
            && lineActiveView.BudgetClass               == this.BudgetClass
            && lineActiveView.Comment                   == this.Comment
            && lineActiveView.DimensionValue1           == this.DimensionValue1
            && lineActiveView.DimensionValue2           == this.DimensionValue2
            && lineActiveView.DimensionValue3           == this.DimensionValue3
            && lineActiveView.DimensionValue4           == this.DimensionValue4
            && lineActiveView.DimensionValue5           == this.DimensionValue5
            && lineActiveView.DimensionValue6           == this.DimensionValue6
            && lineActiveView.DimensionValue7           == this.DimensionValue7
            && lineActiveView.DimensionValue8           == this.DimensionValue8
            && lineActiveView.DimensionValue9           == this.DimensionValue9
            && lineActiveView.DimensionValue10          == this.DimensionValue10
            && lineActiveView.DimensionValue11          == this.DimensionValue11
            && lineActiveView.IsNewRequest              == this.IsNewRequest
            && (!matchIsRecurring
                || lineActiveView.IsRecurring           == this.IsRecurring)
            && lineActiveView.Position                  == this.Position
            && lineActiveView.PositionScenario          == this.PositionScenario
            && lineActiveView.ProjectId                 == this.ProjectId
            && lineActiveView.ProposedAsset             == this.ProposedAsset
            && lineActiveView.ProposedProject           == this.ProposedProject
            && (!matchCurrency
                || lineActiveView.TransactionCurrencyCode == this.TransactionCurrencyCode);

    return lineActiveView.RecId != 0;
}

private void setBudgetPlanHeaderInUse()
{
    BudgetPlanHeader budgetPlanHeader = BudgetPlanHeader::find(this.BudgetPlanHeader);
    if (budgetPlanHeader.RecId && budgetPlanHeader.InUseBy == BudgetPlanningConstants::emptyString)
    {
        BudgetPlan::setInUse(budgetPlanHeader);
    }
}

private void resetBudgetPlanHeaderInUse()
{
    BudgetPlanHeader budgetPlanHeader = BudgetPlanHeader::find(this.BudgetPlanHeader);
    if (budgetPlanHeader.RecId && budgetPlanHeader.InUseBy != BudgetPlanningConstants::emptyString)
    {
        BudgetPlan::clearInUse(budgetPlanHeader.RecId);
    }
}
